import { CSSProperties, useCallback } from "react"
import { Token, TokenInputProps, TokenOutputProps } from "../types"
import clsx from "clsx"

export const useGetTokenProps = (themeDictionary?: ThemeDict) => {
  const styleForToken = useCallback(
    ({ types, empty }: Token) => {
      if (themeDictionary == null) return undefined
      else if (types.length === 1 && types[0] === "plain") {
        return empty != null ? { display: "inline-block" } : undefined
      } else if (types.length === 1 && empty != null) {
        return themeDictionary[types[0]]
      }

      return Object.assign(
        empty != null ? { display: "inline-block" } : {},
        ...types.map(type => themeDictionary[type])
      ) satisfies CSSProperties
    },
    [themeDictionary]
  )

  return useCallback(
    ({ token, className, style, ...rest }: TokenInputProps) => {
      const output: TokenOutputProps = {
        ...rest,
        className: clsx("token", ...token.types, className),
        children: token.content,
        style: styleForToken(token),
      }

      if (style != null) {
        output.style = {
          ...(output.style || {}),
          ...style,
        }
      }

      return output
    },
    [styleForToken]
  )
}
import type { Token } from "../types"
import type { Token as PrismToken, TokenStream } from "prismjs"

const newlineRe = /\r\n|\r|\n/

// Empty lines need to contain a single empty token, denoted with { empty: true }
const normalizeEmptyLines = (line: Token[]) => {
  if (line.length === 0) {
    line.push({
      types: ["plain"],
      content: "\n",
      empty: true,
    })
  } else if (line.length === 1 && line[0].content === "") {
    line[0].content = "\n"
    line[0].empty = true
  }
}

const appendTypes = (types: string[], add: string[] | string): string[] => {
  const typesSize = types.length

  if (typesSize > 0 && types[typesSize - 1] === add) {
    return types
  }

  return types.concat(add)
}

// Takes an array of Prism's tokens and groups them by line, turning plain
// strings into tokens as well. Tokens can become recursive in some cases,
// which means that their types are concatenated. Plain-string tokens however
// are always of type "plain".
// This is not recursive to avoid exceeding the call-stack limit, since it's unclear
// how nested Prism's tokens can become
const normalizeTokens = (tokens: (PrismToken | string)[]): Token[][] => {
  const typeArrStack: string[][] = [[]]
  const tokenArrStack = [tokens]
  const tokenArrIndexStack = [0]
  const tokenArrSizeStack = [tokens.length]
  let i = 0
  let stackIndex = 0
  let currentLine: Token[] = []
  const acc = [currentLine]

  while (stackIndex > -1) {
    while (
      (i = tokenArrIndexStack[stackIndex]++) < tokenArrSizeStack[stackIndex]
    ) {
      let content: TokenStream
      let types = typeArrStack[stackIndex]
      const tokenArr = tokenArrStack[stackIndex]
      const token = tokenArr[i]

      // Determine content and append type to types if necessary
      if (typeof token === "string") {
        types = stackIndex > 0 ? types : ["plain"]
        content = token
      } else {
        types = appendTypes(types, token.type)

        if (token.alias) {
          types = appendTypes(types, token.alias)
        }

        content = token.content
      }

      // If token.content is an array, increase the stack depth and repeat this while-loop
      if (typeof content !== "string") {
        stackIndex++
        typeArrStack.push(types)
        tokenArrStack.push(content as PrismToken[])
        tokenArrIndexStack.push(0)
        tokenArrSizeStack.push(content.length)
        continue
      }

      // Split by newlines
      const splitByNewlines = content.split(newlineRe)
      const newlineCount = splitByNewlines.length
      currentLine.push({
        types,
        content: splitByNewlines[0],
      })

      // Create a new line for each string on a new line
      for (let i = 1; i < newlineCount; i++) {
        normalizeEmptyLines(currentLine)
        acc.push((currentLine = []))
        currentLine.push({
          types,
          content: splitByNewlines[i],
        })
      }
    }

    // Decreate the stack depth
    stackIndex--
    typeArrStack.pop()
    tokenArrStack.pop()
    tokenArrIndexStack.pop()
    tokenArrSizeStack.pop()
  }

  normalizeEmptyLines(currentLine)
  return acc
}

export default normalizeTokens
import { EnvConfig, Language, PrismGrammar, PrismLib } from "../types"
import normalizeTokens from "../utils/normalizeTokens"
import { useMemo, useRef } from "react"

type Options = {
  prism: PrismLib
  code: string
  grammar?: PrismGrammar
  language: Language
}

export const useTokenize = ({ prism, code, grammar, language }: Options) => {
  const prismRef = useRef(prism)
  return useMemo(() => {
    if (grammar == null) return normalizeTokens([code])

    const prismConfig: EnvConfig = {
      code,
      grammar,
      language,
      tokens: [],
    }

    prismRef.current.hooks.run("before-tokenize", prismConfig)
    prismConfig.tokens = prismRef.current.tokenize(code, grammar)
    prismRef.current.hooks.run("after-tokenize", prismConfig)
    return normalizeTokens(prismConfig.tokens)
  }, [code, grammar, language])
}
import { InternalHighlightProps } from "../types"
import { useThemeDictionary } from "./useThemeDictionary"
import { useGetLineProps } from "./useGetLineProps"
import { useGetTokenProps } from "./useGetTokenProps"
import { useTokenize } from "./useTokenize"

export const Highlight = ({
  children,
  language: _language,
  code,
  theme,
  prism,
}: InternalHighlightProps) => {
  const language = _language.toLowerCase()
  const themeDictionary = useThemeDictionary(language, theme)
  const getLineProps = useGetLineProps(themeDictionary)
  const getTokenProps = useGetTokenProps(themeDictionary)
  const grammar = prism.languages[language]
  const tokens = useTokenize({ prism, language, code, grammar })

  return children({
    tokens,
    className: `prism-code language-${language}`,
    style: themeDictionary != null ? themeDictionary.root : {},
    getLineProps,
    getTokenProps,
  })
}
